import piggyBank from '../Images/piggy-bank.jpeg';
function Home() {
  return (
    <div>
      <div className="md:flex items-center justify-between bg-violet py-4 md:px-10 px-7">
      <img src={piggyBank} alt="Piggy Bank"/>
      </div>
    </div>
  );
}

export default Home;
